DROP TABLE IF EXISTS `income`;
CREATE TABLE `income` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `lesson_id` int(10) NOT NULL,
  `lesson` varchar(60) NOT NULL,
  `goods` varchar(60) NOT NULL,
  `goods_id` int(11) NOT NULL,
  `camp_id` int(10) NOT NULL COMMENT '训练营id',
  `camp` varchar(60) NOT NULL,
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '单价',
  `total` tinyint(4) NOT NULL DEFAULT '1' COMMENT '购买总数',
  `balance_pay` decimal(12,2) NOT NULL COMMENT '订单总金额',
  `income` decimal(12,2) NOT NULL COMMENT '训练营收入',
  `member_id` int(10) NOT NULL COMMENT '购买者id',
  `member` varchar(60) NOT NULL,
  `student_id` int(11) NOT NULL,
  `student` varchar(60) NOT NULL,
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1:课程订单收入|2:活动订单收入|3:课时收入|4:充值',
  `f_id` int(11) NOT NULL DEFAULT '0' COMMENT '外键',
  `bill_id` int(11) NOT NULL COMMENT '订单id',
  `bill_order` varchar(60) NOT NULL,
  `schedule_income` decimal(8,2) NOT NULL COMMENT '课时总价',
  `schedule_id` int(11) NOT NULL COMMENT '课时id',
  `students` tinyint(4) NOT NULL DEFAULT '1' COMMENT '人次',
  `system_remarks` varchar(255) NOT NULL,
  `s_balance` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '数据前余额',
  `e_balance` decimal(11,2) DEFAULT '0.00' COMMENT '数据产生后余额',
  `system_rebate` decimal(4,2) NOT NULL DEFAULT '0.00',
  `status` tinyint(4) NOT NULL DEFAULT '1',
  `create_time` int(10) NOT NULL,
  `update_time` int(10) NOT NULL,
  `delete_time` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=156 DEFAULT CHARSET=utf8 COMMENT='训练营收入表';

